  vcd_num = vcd_reserve_ids(sim_hdl, 39u);
  unsigned int num = vcd_num;
  for (unsigned int clk = 0u; clk < bk_num_clocks(sim_hdl); ++clk)
    vcd_add_clock_def(sim_hdl, this, bk_clock_name(sim_hdl, clk), bk_clock_vcd_num(sim_hdl, clk));
  vcd_write_def(sim_hdl, bk_clock_vcd_num(sim_hdl, __clk_handle_0), "CLK", 1u);
  vcd_write_def(sim_hdl, num++, "RST_N", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "WILL_FIRE_RL_action_l175c12", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "WILL_FIRE_RL_action_l176c1", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "WILL_FIRE_RL_action_l177c9", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "dut_incoming_first____d22", 128u);
  num = INST_abort.dump_VCD_defs(num);
  num = INST_dut_adder_in.dump_VCD_defs(num);
  num = INST_dut_adder_out.dump_VCD_defs(num);
  num = INST_dut_flag_a.dump_VCD_defs(num);
  num = INST_dut_flag_adder.dump_VCD_defs(num);
  num = INST_dut_flag_b.dump_VCD_defs(num);
  num = INST_dut_flag_c.dump_VCD_defs(num);
  num = INST_dut_flag_last.dump_VCD_defs(num);
  num = INST_dut_flag_mul.dump_VCD_defs(num);
  num = INST_dut_flag_start.dump_VCD_defs(num);
  num = INST_dut_incoming.dump_VCD_defs(num);
  num = INST_dut_mul_in.dump_VCD_defs(num);
  num = INST_dut_mul_out.dump_VCD_defs(num);
  num = INST_dut_mulresult.dump_VCD_defs(num);
  num = INST_dut_reg_a.dump_VCD_defs(num);
  num = INST_dut_reg_b.dump_VCD_defs(num);
  num = INST_dut_reg_c.dump_VCD_defs(num);
  num = INST_dut_reg_d.dump_VCD_defs(num);
  num = INST_dut_reg_e.dump_VCD_defs(num);
  num = INST_dut_resultadder.dump_VCD_defs(num);
  num = INST_dut_resultsub.dump_VCD_defs(num);
  num = INST_dut_sqrt_in.dump_VCD_defs(num);
  num = INST_dut_sqrt_out.dump_VCD_defs(num);
  num = INST_running.dump_VCD_defs(num);
  num = INST_start_reg.dump_VCD_defs(num);
  num = INST_start_reg_1.dump_VCD_defs(num);
  num = INST_start_reg_2.dump_VCD_defs(num);
