void MOD_mkTB::dump_VCD(tVCDDumpType dt, unsigned int levels, MOD_mkTB &backing)
{
  vcd_defs(dt, backing);
  vcd_prims(dt, backing);
}

void MOD_mkTB::vcd_defs(tVCDDumpType dt, MOD_mkTB &backing)
{
  unsigned int num = vcd_num;
  if (dt == VCD_DUMP_XS)
  {
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 128u);
  }
  else
    if (dt == VCD_DUMP_CHANGES)
    {
      if ((backing.PORT_RST_N) != PORT_RST_N)
      {
	vcd_write_val(sim_hdl, num, PORT_RST_N, 1u);
	backing.PORT_RST_N = PORT_RST_N;
      }
      ++num;
      if ((backing.DEF_WILL_FIRE_RL_action_l175c12) != DEF_WILL_FIRE_RL_action_l175c12)
      {
	vcd_write_val(sim_hdl, num, DEF_WILL_FIRE_RL_action_l175c12, 1u);
	backing.DEF_WILL_FIRE_RL_action_l175c12 = DEF_WILL_FIRE_RL_action_l175c12;
      }
      ++num;
      if ((backing.DEF_WILL_FIRE_RL_action_l176c1) != DEF_WILL_FIRE_RL_action_l176c1)
      {
	vcd_write_val(sim_hdl, num, DEF_WILL_FIRE_RL_action_l176c1, 1u);
	backing.DEF_WILL_FIRE_RL_action_l176c1 = DEF_WILL_FIRE_RL_action_l176c1;
      }
      ++num;
      if ((backing.DEF_WILL_FIRE_RL_action_l177c9) != DEF_WILL_FIRE_RL_action_l177c9)
      {
	vcd_write_val(sim_hdl, num, DEF_WILL_FIRE_RL_action_l177c9, 1u);
	backing.DEF_WILL_FIRE_RL_action_l177c9 = DEF_WILL_FIRE_RL_action_l177c9;
      }
      ++num;
      if ((backing.DEF_dut_incoming_first____d22) != DEF_dut_incoming_first____d22)
      {
	vcd_write_val(sim_hdl, num, DEF_dut_incoming_first____d22, 128u);
	backing.DEF_dut_incoming_first____d22 = DEF_dut_incoming_first____d22;
      }
      ++num;
    }
    else
    {
      vcd_write_val(sim_hdl, num++, PORT_RST_N, 1u);
      backing.PORT_RST_N = PORT_RST_N;
      vcd_write_val(sim_hdl, num++, DEF_WILL_FIRE_RL_action_l175c12, 1u);
      backing.DEF_WILL_FIRE_RL_action_l175c12 = DEF_WILL_FIRE_RL_action_l175c12;
      vcd_write_val(sim_hdl, num++, DEF_WILL_FIRE_RL_action_l176c1, 1u);
      backing.DEF_WILL_FIRE_RL_action_l176c1 = DEF_WILL_FIRE_RL_action_l176c1;
      vcd_write_val(sim_hdl, num++, DEF_WILL_FIRE_RL_action_l177c9, 1u);
      backing.DEF_WILL_FIRE_RL_action_l177c9 = DEF_WILL_FIRE_RL_action_l177c9;
      vcd_write_val(sim_hdl, num++, DEF_dut_incoming_first____d22, 128u);
      backing.DEF_dut_incoming_first____d22 = DEF_dut_incoming_first____d22;
    }
}

